import Logo from "./LogoList.js";
import Images from "./ImagesList.js";
export default {
  components: {
    ...Logo.Components,
    ...Images.Components
  },
  props: {
    shop: {
      type: String,
      required: true
    },
    activeCategory: {
      type: [Object, null]
    }
  },
  computed: {
    getImage() {
      return this.activeCategory ? Images.Main[this.activeCategory.type] : Logo.Main[this.shop];
    },
    getType() {
      return this.activeCategory ? `special` : `default ${this.shop}`;
    }
  }
};
